Plea Colloquy.
Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed and read in.  Count 3 is dismissed by operation of law.

The Court Orders the Following:

Imposed and Stayed Sentence of 

 6 Years Imprisonment (Credit - 2 days )  Defense has 10 days to submit a written statement regarding change in credit.  State has an additional 10 days to respond.
- 3 Years of Initial Confinement
- 3 Years of Extended Supervision

